import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const useStyles = makeStyles({
  table: {
    minWidth: 650,
    background: "#A8A9AC"
  },
});

function createData(name, calories, fat, carbs, protein, modification, creation) {
  return { name, calories, fat, carbs, protein, modification, creation };
}

const rows = [
  createData('Frozen yoghurt', 159, 6.0, 24, 4.0, 'Jamais', 'Ajourd\'hui'),
  /*createData('Ice cream sandwich', 237, 9.0, 37, 4.3, 'Jamais', 'Ajourd\'hui'),
  createData('Eclair', 262, 16.0, 24, 6.0, 'Jamais', 'Ajourd\'hui'),
  createData('Cupcake', 305, 3.7, 67, 4.3, 'Jamais', 'Ajourd\'hui'),
  createData('Gingerbread', 356, 16.0, 49, 3.9, 'Jamais', 'Ajourd\'hui'),*/
];

export default function BasicTable() {
  const classes = useStyles();

  return (
    <TableContainer component={Paper}>
      <Table className={classes.table} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>Numéro de commande</TableCell>
            <TableCell align="right">Entreprise</TableCell>
            <TableCell align="right">Nom</TableCell>
            <TableCell align="right">PO du client</TableCell>
            <TableCell align="right">Vendeur</TableCell>
            <TableCell align="right">Date de modification</TableCell>
            <TableCell align="right">Date de création</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow key={row.name}>
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>
              <TableCell align="right">{row.calories}</TableCell>
              <TableCell align="right">{row.fat}</TableCell>
              <TableCell align="right">{row.carbs}</TableCell>
              <TableCell align="right">{row.protein}</TableCell>
              <TableCell align="right">{row.modification}</TableCell>
              <TableCell align="right">{row.creation}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
